                                <p>Steven Montiero, a spokesman for the patrol, says a preliminary investigation shows a front tire may have malfunctioned, causing the SUV to flip.</p><p>He says three girls were pronounced dead at the scene and eight others were taken to a hospital. He says the people inside were family and friends. They weren't immediately identified.</p><p>Among those injured was a child who Montiero says was ejected over a perimeter fence. He says rescuers heard the child crying.</p><p>Montiero says it's clear at least some people weren't wearing seatbelts.</p></span>
                        </section>
